import styled from 'styled-components';

const Header = styled.header`
  width: 100%;
  height: 50px;
  padding: 40px 20px 20px 64px;
  display: flex;
  align-items: center;
  border-bottom: 3px solid var();
`;

const Logo = styled.button`
background-color: inherit;
border: none;
`;



export {Header, Logo}
